sys_variable_value.value:
(function execute(inputs, outputs) {

  if (inputs.status != "200") {
      outputs.status = "Error";
      outputs.api_response = "Error";
      gs.error("Error While Looking up Entity. Error:" + inputs.errorMessage + " Response Received:" + inputs["response"]);
    return;
  }

  var responseObject = JSON.parse(inputs.responseBody);
  /* when the call is successful, the SAM API returns: 
    {
      "totalRecords": 0,
      "entityData": []
    }
  */

  // if no entity is found,
  if (responseObject.totalRecords == 0) {
    outputs.api_response = "Entity Not Found";
    return;
  }

  // Successful and Entity was Found
  outputs.api_response = "Entity Found";
  gs.warn("Lookup Entity: responseObject.entityData = " + JSON.stringify(responseObject.entityData));

  // The API can return multiple entities but we process only one in this Look up Entity action
  var entityData = responseObject.entityData[0];

  outputs.Entity = {};
  outputs.Entity.registrationStatus = entityData.entityRegistration.registrationStatus;
  outputs.Entity.registrationExpirationDate = entityData.entityRegistration.registrationExpirationDate;
  outputs.Entity.physicalAddress = {};
  outputs.Entity.physicalAddress.addressLine1 = entityData.coreData.physicalAddress.addressLine1;

  /** 
   * The API returns  "sbaBusinessTypeList": []
   * 
   * Transform the variable sbaBusinessTypeList from a list to a variable "sbaBusinessTypeList" of type object
   * so that we can access data like sbaBusinessType.A6.certificationExitDate and get the value "2030-04-29"
   */
 /* 
  {
    "SBA Business Type": {
        "A6": {
            "certificationEntryDate": "2020-04-30",
            "certificationExitDate": "2030-04-29"
        },
        "XX": {
            "certificationEntryDate": "2015-04-20",
            "certificationExitDate": null
        }
    }
}
*/
  let sbaBusinessTypeList = entityData.coreData.businessTypes.sbaBusinessTypeList;
  let sbaBusinessType = {};
  sbaBusinessTypeList.forEach(function (item) {
    sbaBusinessType[item.sbaBusinessTypeCode] = item;
	//  Set the certified boolean values so that we can query = sbaBusinessType.A6.certified ?
    sbaBusinessType[item.sbaBusinessTypeCode]["certified"] = true;
  });
  outputs.Entity.sbaBusinessType = sbaBusinessType;
  gs.warn("sbaBusinessType: " + JSON.stringify(sbaBusinessType));


})(inputs, outputs);

